import React from 'react';

class Login extends React.Component {
  render() {
    return (
      <div data-testid="page-login">
        <label htmlFor="inputLogin">
          <input
            type="text"
            name="inputLogin"
            id="inputLogin"
            data-testid="login-name-input"
          />
        </label>
      </div>
    );
  }
}
export default Login;
